import React, { Component } from 'react';
import GeoComponentPush from './GeoPushComponent.js';
import haverDistance from './myHaverSine.js';

var closestLokation = new Lokation('test',2,2);

class Lokation extends React.Component {
    constructor(lokationName, latitude,longitude){
        super()
        this.lokationName = lokationName;
        this.latitude = latitude;
        this.longitude = longitude;

        this.state = {
          distance: 2,
          description: '',
          locationInfo: ''
        };
    }
}

export default Lokation;
